  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Sabine NWR outlines
  Refuge accomplishments from February through April of 1939. The report begins by
  summarizing the weather conditions during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, and predators- is also covered.
  The Refuge development and maintenance section discusses physical developments and
  prescribed burning. Resource management is outlined; topics include grazing. The
  public relations section of the report describes Refuge visitors, hunting, and fishing.\",\n\t\"owner_org\":
